import axios from 'axios'

const URL = 'http://localhost:8000';
export const addUser = async (data) =>{
    try{
        return await axios.post(`${URL}/add`, data);      

    }catch (error){
        console.log(error)
    }
    
}

export const getUser = async() => {
    try{
        return await axios.get(`${URL}/get`);
    }catch(error){
        console.log(error)
    }
}
